cnt = 0
class S(BaseHTTPRequestHandler):
    def _set_headers(self):
        self.send_response(200)
        self.send_header("Content-type", "application/json")
        self.end_headers()

    def do_GET(self):
        global cnt

        self._set_headers()
        self.wfile.write(json.dumps(webhooks).encode("utf-8"))

        if cnt >= 2:
            print("exiting because cnt > 2 for http calls")
            exit()

        cnt += 1
        
    def do_HEAD(self):
        self._set_headers()

    def do_POST(self):
        global cnt

        # Doesn't do anything with posted data
        self._set_headers()
        self.wfile.write(json.dumps(webhooks).encode("utf-8"))

        if cnt >= 2:
            print("exiting because cnt > 2 for http calls")
            exit()

        cnt += 1

@timeout(timeout_seconds)
def run(server_class=HTTPServer, handler_class=S, addr="localhost", port=10080):
    server_address = (addr, port)
    httpd = server_class(server_address, handler_class)

    print(f"Starting httpd server on {addr}:{port} for %d seconds" % timeout_seconds)
    httpd.serve_forever()


