def set_workflow(id, workflow):
    parsed_url = "%s/api/v1/workflows/%s" % (shuffle_url, id)
    #print("Setting workflow to url %s" % parsed_url)
    workflow["id"] = id
    ret = requests.put(parsed_url, headers=headers, json=workflow)
    return ret.json()

def get_github_workflow(url):
    workflow = requests.get(url).json()

    for trigger in workflow["triggers"]:
        if trigger["app_name"] == "Webhook":
            start_webhook(workflow["id"], workflow["start"], trigger["id"])
            trigger["status"] = "running"
            print("\nWebhook ID for %s: %s" % (workflow["name"], trigger["id"]))

            if "hive" in workflow["name"].lower():
                webhooks["thehive"] = "%s/api/v1/hooks/webhook_%s" % (shuffle_url, trigger["id"])
            elif "wazuh" in workflow["name"].lower():
                webhooks["wazuh"] = "%s/api/v1/hooks/webhook_%s" % (shuffle_url, trigger["id"])
    for action in workflow["actions"]:
        #print(action["app_name"])
        if action["app_name"] == "GreyNoise":
            action["authentication_id"] = auth["greynoise"]
        if action["app_name"] == "Virustotal":
            action["authentication_id"] = auth["virustotal"]
        if action["app_name"] == "TheHive":
            action["authentication_id"] = auth["thehive"]
        if action["app_name"] == "thehive":
            #print("Adding auth %s to action %s!" % (auth["thehive"], action["label"]))
            action["authentication_id"] = auth["thehive"]
        if action["app_name"] == "MISP":
            action["authentication_id"] = auth["misp"]
        if action["app_name"] == "misp":
            action["authentication_id"] = auth["misp"]
        if "Wazuh" in action["app_name"]:
            action["authentication_id"] = auth["wazuh"]

    return workflow

