def create_authentication():
    ret = handle_wazuh_auth(wazuh_apikey, wazuh_url)
    auth["wazuh"] = ret
    ret = handle_th_auth(thehive_apikey, thehive_url)
    auth["thehive"] = ret
    ret = handle_misp_auth(misp_apikey, misp_url)
    auth["misp"] = ret
    ret = handle_greynoise_auth(greynoise_apikey)
    auth["greynoise"] = ret
    ret = handle_vt_auth(virustotal_apikey)
    auth["virustotal"] = ret

    return auth

